import React from "react";
import "./intro.css";
import profilePic from "../../../resources/pic/joey.JPG";

const Intro = () => {
  return (
    <div className="intro">
      <div className="left">
        <div className="container">
          <img className="profile" src={profilePic} alt="profile picture" />
        </div>
      </div>
      <div className="right">right</div>
    </div>
  );
};

export default Intro;
